package pe.edu.upc.polarnet.shared.models
import kotlinx.serialization.Serializable
@Serializable data class ServiceRequest( val id: Long = 0, val clientId: Long, val equipmentId: Long, val requestType: RequestType, val description: String?, val startDate: String, val endDate: String?, val status: RequestStatus = RequestStatus.PENDING, val totalPrice: Double, val notes: String?, val createdAt: String? = null )
enum class RequestType { RENTAL, MAINTENANCE, INSTALLATION }
enum class RequestStatus { PENDING, IN_PROGRESS, COMPLETED, CANCELLED }
